import { useEffect, useState } from "react";
import { Icon as Iconify } from "@iconify/react";
import { useQuery, gql } from "@apollo/client";
import { basicQueryResultSupport } from "../helpers/apollo-helpers";
import { useDisclosure, Box, Flex, Text, Icon, Container, Grid, Image  } from "@chakra-ui/react";
import Head from "next/head";
import NextLink from "next/link";

import { useUserContext } from "../context/user";
import { GaIconButton } from "../features/GaButton";
import { CoinCurrency, StarCurrency } from "../features/Currency";
import Loading from "../features/Loading";
import Error from "../features/Error";
import CalendarModal from "../features/modals/CalendarModal";
import RewardPopup from "../features/modals/RewardPopup";
import FirstGigil from "../features/modals/FirstGigil";
import HowToPlayPopup from "../features/modals/HowToPlayPopup";
import StripeComponent from "../features/stripe/StripeComponent";
import GoogleAd from "../features/GoogleAd";
import GameSection from "../features/GameSection";

import Button from "../ui/Button";
import { KnowlympicsButton } from "../ui/Button";
import { MyAvatar } from "../ui/Avatar";
import GiftIcon from "../ui/icons/GiftIcon";

import { isPremium } from "../helpers/premium";

const TOP_RANKING_USERS = gql`
  query RankingUsers {
    rankingUsers: currentRankingUsers {
      userId
      points
      username
      currentAvatar {
        picture
      }
    }
  }
`;

export default function Home() {
  const [currentUser] = useUserContext();
  const { isOpen, onOpen, onClose } = useDisclosure();
  const [topRank, setTopRank] = useState([]);
  const [userRanking, setUserRanking] = useState(0);

  const { loading, error  } = useQuery(TOP_RANKING_USERS, {
    fetchPolicy: "no-cache",
    onCompleted: (data) => {
      setTopRank(data.rankingUsers.slice(0, 5));
      const userIndex = data.rankingUsers.findIndex(
        (user) =>{ 
          return user.userId === currentUser.userId
        }
      );
      setUserRanking(userIndex + 1);
    },
    ...basicQueryResultSupport,
  });

  useEffect(() => {
    if (currentUser.rankingGift) {
      onOpen();
    }
  }, [currentUser.rankingGift, onOpen]);

  return (
    <>
      <Head>
        <title>Know It!</title>
        <meta
          name="description"
          content="A learning by gaming Progressive Web App to test and improve your English!"
        />
      </Head>

      <Container
        minW={{ base: "100vw", lg: "85vw", xl: "90vw" }}
        pt={{ base: "0", lg: "2rem" }}
        pb={{ base: "5rem", lg: "2rem" }}
      >
        {/* User detail in mobile display */}
        <Flex
          display={{ base: "flex", lg: "none" }}
          bg="deepDarkBlue"
          boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)"
          borderRadius="15px"
          marginTop={{ base: "3.5vh", lg: "0" }}
          mb={{ base: "5vh", lg: "0" }}
          px="0.65rem"
          py="0.35rem"
          justify="space-between"
          alignItems="center"
        >
        {
          currentUser.online ? 
          <Flex alignItems="center">
            <MyAvatar size="md" mr="1rem" boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)" />
            <Box>
              <NextLink href="/profile">
                <Text
                  fontWeight="semibold"
                  fontSize="1.2rem"
                >
                  { currentUser.username }
                </Text>
              </NextLink>
              <Flex>
                <StarCurrency rightIcon fontSize="lg" fontWeight="semibold" boxSize="22px" mr="0.5rem" />
                <CoinCurrency rightIcon fontSize="lg" fontWeight="semibold" boxSize="22px" />
              </Flex>
            </Box>
          </Flex>
          :
          <NextLink href="/login">
            <Text p="0.5rem" color="white" fontSize="1.2rem" fontWeight="bold">
              Login
            </Text>
          </NextLink>
        }
          <NextLink href="/settings">
            <Icon 
              as={Iconify}
              icon="ci:settings-filled"
              h="2rem"
              w="2rem"
            />
          </NextLink>
        </Flex>

        <Box
          display={{ base: "none", lg: "grid" }}
          gridTemplateColumns="repeat(2, 1fr)"
          gridGap={{ base: "0", lg: "3vh" }}
          mb={{ lg: "3vh" }}
        >
          {/* Shop Box */}
          <Box
            bg="deepDarkBlue"
            boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)"
            borderRadius="15px"
            padding="1rem"
            position="relative"
          >
            <Text
              fontWeight="semibold"
              fontSize={{ base: "0.3rem", md:"0.5rem", lg: "1rem", xl: "1.5rem" }}
            >
              Play games, earn coins and collect all the Gigils Monsters!
            </Text>

            <Box
              w={{lg:"100%", xl:"70%"}}
              mx="auto"
            >
              <SvgComponent />
            </Box>
            
            <Flex
              position="absolute"
              bottom="1rem"
              right="0"
              left="0"
            >
              <Button
                mx="auto"
                px="5rem"
                href="/shop/coins"
              >
                Go to Shop
              </Button>
            </Flex>
          </Box>

          <Grid
            gridTemplateRows="repeat(2, 1fr)"
            gridGap={{ base: "0", lg: "3vh" }}
          >
            {/* User detail */}
            <Grid
              bg="deepDarkBlue"
              boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)"
              gridTemplateColumns="repeat(3, 1fr)"
              borderRadius="15px"
              padding="1rem"
              gap="1rem"
              alignItems="center"
              justifyContent="space-between"
            >
              <Box
                gridColumn={ currentUser?.points > 0 ? "span 2" : "span 3" }
              >
                { userRanking === 0 ? 
                  <Text
                    fontWeight="semibold"
                    textAlign="center"
                    fontSize={{ lg: "1rem", xl: "1.5rem" }}
                    mb={{ base: "1rem", lg: "2rem" }}
                  >
                    Play in the KNOWLYMPICS to rank in the Top 5!
                  </Text>
                  :
                  (
                    <Text
                      fontWeight="semibold"
                      textAlign="center"
                      fontSize={{ lg: "1rem", xl: "1.5rem" }}
                      mb="1rem"
                    >
                      You rank #{ userRanking } this week in the<br/> KNOWLYMPICS
                    </Text>
                  )
                }
                <Flex
                  justify="space-between"
                  alignItems="center"
                  textAlign="center"
                  flexDirection="column"
                >
                  <Button
                    className={currentUser?.stars ? "notification" : null}
                    bg="green"
                    marginLeft="auto"
                    marginRight="auto"
                    fontSize="1.2rem"
                    w="100%"
                    mx="3rem"
                    href="/games/knowlympics"
                    disabled={currentUser?.stars < 1}
                  >
                    KNOWLYMPICS
                  </Button>
                  {
                    (currentUser?.stars < 1) && 
                    (
                      <Text fontSize="xs">
                        You need to be logged in and have at least one star to play KNOWLYMPICS
                      </Text>
                    )
                  }
                </Flex>
              </Box>
              {
                currentUser?.points > 0 && (
                  <Flex
                    marginLeft="auto"
                    marginRight="auto"
                    px="1.5rem"
                    flexDirection="column"
                    borderLeft="1px"
                    borderLeftColor="blueClear.500"
                  >
                    <Image 
                      boxSize={{ base: "2rem", lg: "3rem", xl: "12vh" }}
                      src="/images/medal.png" 
                      marginLeft="auto"
                      marginRight="auto"
                      alt="medal"
                    />
                    <Text
                      textAlign="center"
                      fontWeight="semibold"
                    >
                      { currentUser?.points } Medals
                    </Text>
                  </Flex>
                )
              }
            </Grid>
            {/* Top 5 Knowlympics */}
            <Flex
              bg="deepDarkBlue"
              boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)"
              flexDirection="column"
              borderRadius="15px"
              py="0.5rem"
              px="1rem"
            >
              <Text
                fontWeight="semibold"
                fontSize={{ base: "0.3rem", md:"0.5rem", lg: "1rem", xl: "1.5rem" }}
                mb="0.5rem"
              >
                Knowlympics Top 5
              </Text>
              <Grid gridTemplateColumns="repeat(5, 1fr)">
              {
                (topRank.length > 0) && 
                topRank.map((user, index) => (
                  <NextLink
                    key={user.userId}
                    href={`/profile/${user.userId}`}
                  >
                    <Flex
                      alignItems="center"
                      flexDirection="column"
                      justify="space-between"
                      minW={{ base: "5vw", lg: "5vw", xl:"8vw" }}
                    >
                      <Box
                        position="relative"
                        borderRadius="0.5rem"
                        overflow="hidden"
                      >
                        <MyAvatar
                          borderRadius="0.5rem"
                          w={{ lg: "7vw", '2xl':"5vw" }}
                          h="100%"
                          src={user?.currentAvatar?.picture}
                          boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)"
                        />
                        <Text
                          position="absolute"
                          top="0"
                          right="0"
                          bg="blueClear.500"
                          px="0.5rem"
                          pb="0.1rem"
                          fontSize={{ lg: "0.5rem", xl:"0.7rem"}}
                          borderBottomLeftRadius="0.5rem"
                        >
                          { (index + 1) }
                        </Text>
                      </Box>
                      <Text
                        fontWeight="semibold"
                        fontSize={{ base: "0.5rem", lg: "0.7rem", xl: "0.8rem", '2xl': "1rem" }}
                        textAlign="center"
                        overflow="hidden"
                        whiteSpace="nowrap"
                        textOverflow="ellipsis"
                      >
                        {user.username}
                      </Text>
                    </Flex>
                  </NextLink>
                ))
              }
              {loading && <Loading />}
              {error && <Error />}
              {
                ((topRank.length === 0) && !loading) &&
                <Box
                  width="100%"
                >
                  <Text
                    fontWeight="semibold"
                    fontSize={{ lg: "1.2rem", xl: "1.5rem", '2xl': "1.8rem" }}
                    textAlign="center"
                  >
                    The ranking is empty.<br/>
                    Play now and take the first place!
                  </Text>
                </Box>
              }
              </Grid>
            </Flex>
          </Grid>
        </Box>

        <Flex
          flexDirection={{base:"column", lg:"column-reverse"}}
        >
          <GameSection mb={{ base: "5vh", lg: "0" }} boxShadow={{ lg:"0px 4px 4px rgba(0, 0, 0, 0.25)" }}/>

          <Flex
            display={{ base: "flex", lg:"grid"}}
            gridTemplateColumns="repeat(4, 1fr)"
            gridGap="3vh"
            justifyContent="space-between"
            mb={{ base: "5vh", lg: "3vh" }}
          >
            <Flex
              flexDirection={{ base:"column", lg:"row" }}
              flexGrow="1"
              alignItems="center"
              bg={{ lg:"deepDarkBlue" }}
              boxShadow={{ lg:"0px 4px 4px rgba(0, 0, 0, 0.25)" }}
              borderRadius={{ lg: "0.5rem" }}
              p={{ lg: "1rem" }}
            >
              <GaIconButton
                boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)"
                colorScheme="blueClear"
                label="Grammar Guide+"
                boxSize={{ base: "3.5rem" }}
                target="_blank"
                mx={{ base:"auto", lg:"0" }}
                mb={{ base:"0.5rem", lg:"0" }}
                mr={{lg:"1rem"}}
                href={ isPremium(currentUser) ? "/grammar-module" : "/shop/money" }
                icon={
                  <Image boxSize={{ base: "2.3rem", lg: "3rem" }} src="/images/GrammarGeekImageRight.png" alt="Grammar Guide+" />
                }
              />
              <Text 
                fontSize={{ base: "0.6rem", md:"1rem", lg: "1rem", xl:"1.5rem" }}
                textAlign="center"
              >
                Grammar Guide+
              </Text>
            </Flex>
            <Flex
              flexDirection={{ base:"column", lg:"row" }}
              flexGrow="1"
              alignItems="center"
              bg={{ lg:"deepDarkBlue" }}
              boxShadow={{ lg:"0px 4px 4px rgba(0, 0, 0, 0.25)" }}
              borderRadius={{ lg: "0.5rem" }}
              p={{ lg: "1rem" }}
            >
              <GaIconButton
                boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)"
                colorScheme="red"
                label="Survey"
                boxSize={{ base: "3.5rem" }}
                target="_blank"
                href="https://docs.google.com/forms/d/e/1FAIpQLSc7y4RINsZ-g9gzjP3rSg5AVIfDS2Nu4m09y9Mn--ZvFFr2rA/viewform?usp=pp_url"
                mx={{ base:"auto", lg:"0" }}
                mb={{base:"0.5rem", lg:"0"}}
                mr={{lg:"1rem"}}
                icon={
                  <Icon boxSize={{ base: "2.3rem", lg: "3rem" }} as={Iconify} icon="flat-color-icons:survey" />
                }
              />
              <Text 
                fontSize={{ base: "0.6rem", md:"1rem", lg: "1rem", xl:"1.5rem" }}
                textAlign="center"
              >
                Survey
              </Text>
            </Flex>
            {
              currentUser.online ? (
                <Flex
                  flexDirection={{ base:"column", lg:"row" }}
                  flexGrow="1"
                  alignItems="center"
                  bg={{ lg:"deepDarkBlue" }}
                  boxShadow={{ lg:"0px 4px 4px rgba(0, 0, 0, 0.25)" }}
                  borderRadius={{ lg: "0.5rem" }}
                  p={{ lg: "1rem" }}
                >
                  <GiftButton 
                    mx={{ base:"auto", lg:"0" }}
                    mb={{base:"0.5rem", lg:"0"}}
                  />
                  <Text 
                    fontSize={{ base: "0.7rem", lg: "1rem", xl:"1.5rem" }}
                    textAlign="center"
                    ml={{ lg:"1rem" }}
                  >
                    Free Gift
                  </Text>
                </Flex>
              ) : null
            }
            <Flex
              flexDirection={{ base:"column", lg:"row" }}
              flexGrow="1"
              alignItems="center"
              bg={{ lg:"deepDarkBlue" }}
              boxShadow={{ lg:"0px 4px 4px rgba(0, 0, 0, 0.25)" }}
              borderRadius={{ lg: "0.5rem" }}
              p={{ lg: "1rem" }}
            >
              <GaIconButton
                boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)"
                colorScheme="blueClear"
                label="Leaderboard"
                boxSize={{ base: "3.5rem" }}
                target="_blank"
                href="/knowlympics"
                mx={{ base:"auto", lg:"0" }}
                mb={{base:"0.5rem", lg:"0"}}
                mr={{lg:"1rem"}}
                icon={
                  <Image boxSize={{ base: "1.8rem", lg: "1.8rem" }} src="/images/trophy.png" alt="Leaderboard" />
                }
              />
              <Text 
                fontSize={{ base: "0.6rem", md:"1rem", lg: "1rem", xl:"1.5rem" }}
                textAlign="center"
              >
                Leaderboard
              </Text>
            </Flex>
          </Flex>
        </Flex>

        <KnowlympicsButton
          display={{ base: "flex", lg: "none" }}
          bg="green"
          text="KNOWLYMPICS"
          width="100%"
          disabled={!currentUser?.stars}
        />
      </Container>

      <GoogleAd/>
      <RewardPopup isOpen={isOpen} onClose={onClose} rankingGift={currentUser.rankingGift} />
      <FirstGigil />
      <HowToPlayPopup />
      <StripeComponent />
    </>
  );
}

const GiftButton = ({ ...props }) => {
  const { isOpen, onOpen, onClose } = useDisclosure();

  return (
    <>
      <GaIconButton
        boxShadow="0px 4px 4px rgba(0, 0, 0, 0.25)"
        colorScheme="blueClear"
        boxSize={{ base: "3.5rem" }}
        target="_blank"
        marginRight="0.25rem"
        marginLeft="0.25rem"
        mb="0.5rem"
        label="Calendar"
        onClick={() => onOpen()}
        icon={<GiftIcon boxSize={{ base: "2.3rem", lg: "3rem" }} />}
        {...props}
      />
      <CalendarModal isCalendarOpen={isOpen} onCalendarClose={onClose} />
    </>
  );
};

